Photo by @amivitale // A herd of elephants frolic on Namunyak Wildlife Conservancy in northern Kenya. Across all of Kenya, only 11 elephants were poached in 2020, the lowest number in the history of the @kenyawildlifeservice, down from 350 in 2015. Nevertheless, elephants are still being poached at staggering, unsustainable numbers across Africa, and elephants in Kenya face tremendous pressure from human-wildlife conflict, climate change and drought.

Please follow @amivitale and @r.e.s.c.u.e to learn how to support elephants.

